import React from "react";
import './ticket.scss';
import s7logo from './S7 Logo.png'

export default function Ticket() {

  return (
    <div className="ticket">
      <div className="top-info">
        <div className="price">
          <span className="price__amount">13 400 ла</span>
        </div>
        <div className="logo">
          <img src={s7logo}></img>
        </div>
      </div>
      <div className="bottom-info">
        <div className="time-arrive-container"></div>
        <div className="time-onway-container"></div>
        <div className="transfers-container"></div>
      </div>
    </div>
  );
};
